We already done a lot of work, but due to such underdeveloped software design our template is still not ready to be somewhat usefull. So here we go. Next step is to add new <script>...</script> block after all other script imports. First you'll need to create linkings to functions: functions = {{}} functions['sqrt'] = {{ arg_count: 1, func: function(x){{ return Math.sqrt(x) }}
}} First line defines dictionary variable functions which will be used to store info about funciton linking. Take a notice of doubling '{{' and '}}'. This bracket escaping required by template system. It is advised to write all javascript in separate files and embeded code is used for this tutorial only to demonstrate such detail. Next statement marks 'sqrt' item of functions as function taking one argument and executed as function(x){ return Math.sqrt(x)
} Our first function ready! Only one more to go. Allocation of array is special case of function. Since it needs to know internal structure of virtualmachine, it was hardcoded into it and can be linked as follow: functions['alloc_float'] = {{ arg_count: 1, func: "vm.alloc"
}} Where 'vm.alloc' is magical constant. Its important to notice that it suitable only for such types as float, int and pointers. So far it's all supported types, but with shipment of struct feature (and there for appearance of not 1-sized types will be marked as deprecated.

